import { InsertData } from '../../services/InsertData';

export function get_costumes(state) {
    let responseJson;
    InsertData('costumes', state).then((result) => {
        responseJson = result;
        if(responseJson.costumeData){
            sessionStorage.setItem("state",JSON.stringify(responseJson));
            this.setState({state: responseJson.costumeData});
                console.log(state);
            }
            else{
                alert(result.error);
            }
        
    });
    return responseJson;
}
